import React from "react";
import { SignIn } from "common/index"
import { connect as con } from 'api'

export default function HomePage() {
    const connect = e => {
        e.preventDefault()
        alert('Home Click')
        con()
        .then(res => {alert(`회원가입 완료: ${res.data.result}`)})
        .catch(err => {alert(`회원가입 실패: ${res.data.result}`)})
    }
return (<>
    <SignIn/>
    <button onClick={connect}>커넥트!</button>
</>)
}
